import React from "react";
import Navbar from "../shared/Navbar";
import Footer from "./Footer";
import './mainlayout.css'
const MainLayout = ({ children }) => {
  return (
    <>
      <Navbar />
      <div className="container">
        {children}
        
      </div>
      <Footer />
    </>
  );
};

export default MainLayout;
